import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the first post bookmark button to be available
    await page.waitForSelector('.post:first-child .bookmark-btn', { timeout: 5000 });

    // Click the bookmark button on the first post
    await page.click('.post:first-child .bookmark-btn');

    // Wait for a brief moment to allow the action to complete
    await page.waitForTimeout(1000);

    // Verify that the bookmark icon has become filled
    const isBookmarked = await page.evaluate(() => {
      const bookmarkIcon = document.querySelector('.post:first-child .bookmark-btn i');
      return bookmarkIcon.classList.contains('filled'); // Assuming 'filled' class indicates a bookmarked state
    });

    // Take a screenshot after bookmarking
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_bookmark.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_bookmark.png'));

    return {
      success: isBookmarked,
      action: isBookmarked ? "Successfully bookmarked the first post." : "Failed to bookmark the first post.",
      extractedData: { isBookmarked },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
